import { Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar/navbar";
import Intro from "./components/intro/intro";
import About from "./components/About/about"
import Skills from "./components/Skills/skills";
import Contact from "./components/Contact/contact";
import Footer from "./components/Footer/footer";

function App() {
  return (
    <div className="App">
      <Routes>

        <Route path="./components/Navbar/navbar" element={<Navbar />} />
        <Route path="./components/intro/intro" element={<Intro/>} />
        <Route path="./components/About/about" element={<About />} />
        <Route path="./components/Skills/skills" element={<Skills/>} />
        <Route path="/contact" element={<Contact/>} />
        <Route path="./components/Footer/footer" element={<Footer/>} />
      </Routes>
    </div>
  );
}

export default App;
